ISLAMABAD, Jan 22 (APP):President of the International Monetary Fund (IMF) Ms. Kristalina Georgieva on Wednesday called on Prime Minister Imran Khan in Davos, Switzerland on the sidelines of the annual meeting of World Economic Forum (WEF) 2020.
Advisor to the Prime Minister on Finance Dr. Abdul Hafeez Sheikh, Special Assistant to PM Syed Zulfiqar Abbas Bukhari, Ambassador at Large on Investments Ali Jehangir Siddiqui, Governor State Bank of Pakistan Raza Baqir were also present.
